window.bookSummaryJSON = "<p><i>Star Wars: Heir to the Empire: Behind the Scenes</i> is a special recording that features new commentary by author Timothy Zahn and editor Betsy Mitchell, written for the 20th anniversary edition of <i>Heir to the Empire</i>, read by Zahn and Mitchell. Included here is audio from the that new unabridged recording to enhance their comments.&nbsp;</p> <p>The biggest event in the history of <i>Star Wars</i> books, <i>Heir to the Empire</i> follows the adventures of Luke Skywalker, Han Solo, and Princess Leia after they led the Rebel Alliance to victory in <i>Star Wars: Episode VI Return of the Jedi.</i></p>"; 
